import './App.css';
import Header from './common/header/Header'
import Pages from './pages/Pages'
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import Data from './components/flashDeals/Data';

function App() {
  const {productItems} = Data

  return (
    <>
      <Router>
        <Header />
        <Switch>
          <Route path="/" exact>
            <Pages />
          </Route>
        </Switch>
      </Router>
    </>
  );
}

export default App;
